$(function(){buildChart("/admin/stats/charts.json")});function buildChart(b){try{$("#charts").highcharts().destroy()}catch(a){}$.getJSON(b,function(c){$("#charts").highcharts("StockChart",{xAxis:{type:"datetime",title:{text:c.title}},yAxis:{title:{text:"Сумма"}},rangeSelector:{selected:1,inputEnabled:false},navigator:{enabled:false},series:[{name:"Еврокредиты",data:c.data.ekr_diff,pointInterval:24*3600*1000},{name:"Кредиты",data:c.data.kr_diff,pointInterval:24*3600*1000},{name:"Монеты",data:c.data.gold_diff,pointInterval:24*3600*1000}]})})};